import React from 'react';

const TestTab = ({ tabName }) => {
  console.log(`Rendering ${tabName} tab`);

  return (
    <div style={{
      padding: '20px',
      background: 'var(--card-bg)',
      borderRadius: '15px',
      border: '1px solid var(--border-color)',
      margin: '20px',
      minHeight: '400px'
    }}>
      <h2 style={{ color: 'var(--text-primary)', marginBottom: '20px' }}>
        {tabName} Tab
      </h2>
      <p style={{ color: 'var(--text-secondary)' }}>
        This is the {tabName} tab. It's working correctly!
      </p>
      <div style={{
        background: 'var(--accent-bg)',
        padding: '15px',
        borderRadius: '10px',
        marginTop: '20px'
      }}>
        <h3 style={{ color: 'var(--text-primary)', margin: '0 0 10px 0' }}>
          Tab Status: âœ… Active
        </h3>
        <p style={{ color: 'var(--text-secondary)', margin: 0 }}>
          All components are loading properly.
        </p>
      </div>
    </div>
  );
};

export default TestTab;
